import React from "react";

export default (props: { onBarkButton: ((event: React.MouseEvent<HTMLButtonElement, MouseEvent>) => void) | undefined; name: React.ReactNode; imagePath: string | undefined; }) => {
    return (
        <div className="DogDetails">
            <button data-test="buttonAlert" onClick={props.onBarkButton}>Bark</button>
            <h1>{props.name}</h1>
            <img src={props.imagePath} width="400" height="200" alt=""/>
        </div>
    );
}
